    <script type="text/javascript">
    var scrolltotop={
        setting: {startline:450, scrollto: 0, scrollduration:200, fadeduration:[500, 100]},
        controlHTML: "<img src=\"http://www.doorservice.kiev.ua/wp-content/uploads/top-3.png\" style=\"z-index:1000; position: absolute;bottom: 0;right: 0;margin:40px 10px;\" />",
        anchorkeyword: "#top",

        state: {isvisible:false, shouldvisible:false},

        scrollup:function(){
            if (!this.cssfixedsupport) {
                this.control.css({opacity:0}) //hide control immediately after clicking it
            }
            var dest=isNaN(this.setting.scrollto)? this.setting.scrollto : parseInt(this.setting.scrollto);
            if (typeof dest=="string" && jQuery("#"+dest).length==1)
                dest=jQuery("#"+dest).offset().top;
            else
                dest=0;
            this.body.animate({scrollTop: dest}, this.setting.scrollduration);
        },
            keepfixed:function(){
            var window=jQuery(window);
            var controlx=window.scrollLeft() + window.width() - this.control.width();
            var controly=window.scrollTop() + window.height() - this.control.height();
            this.control.css({left:controlx+"px", top:controly+"px"})
        },
            togglecontrol:function(){
            var scrolltop=jQuery(window).scrollTop();
            if (!this.cssfixedsupport)
                this.keepfixed();
            this.state.shouldvisible=(scrolltop>=this.setting.startline)? true : false;
            if (this.state.shouldvisible && !this.state.isvisible){
                this.control.stop().animate({opacity:0.8}, this.setting.fadeduration[0]).css("visibility", "visible");
                this.state.isvisible=true;
            }
            else if (this.state.shouldvisible==false && this.state.isvisible){
                this.control.stop().animate({opacity:0}, this.setting.fadeduration[1], function(){
                    $(this).css("visibility", "hidden");
                });
                this.state.isvisible=false;
            }
        },

        init:function(){
            jQuery(document).ready(function($){
                var mainobj=scrolltotop;
                var iebrws=document.all;
                mainobj.cssfixedsupport=!iebrws || iebrws && document.compatMode=="CSS1Compat" && window.XMLHttpRequest;
                mainobj.body = (window.opera)? (document.compatMode=="CSS1Compat"? $("html") : $("body")) : $("html,body");mainobj.control=$(mainobj.controlHTML);mainobj.control
                    .css({position:mainobj.cssfixedsupport? "fixed" : "absolute", bottom:0, right:0, opacity:0, cursor:"pointer"})
                    .attr({title:"Наверх"})
                    .click(function(){mainobj.scrollup(); return false})
                    .appendTo("body");
                if (document.all && !window.XMLHttpRequest && mainobj.control.text()!="")
                    mainobj.control.css({width:mainobj.control.width()});
                mainobj.togglecontrol();
                $("a[href=\"" + mainobj.anchorkeyword +"\"]").click(function(){
                    mainobj.scrollup();
                    return false;
                });
                $(window).bind("scroll resize", function(e){
                    mainobj.togglecontrol();
                });
            });
        }
    };
    scrolltotop.init()
</script>
